import { BsDot } from "react-icons/bs";
import "./Flight.css";

const data = [
  {
    id: 1,
    brand: "VietNam Airline",
    flight: "VN - 213",
    time: "21:35 - 23 - 40",
    price: "780,000",
  },
  {
    id: 2,
    brand: "VietNam Airline",
    flight: "VN - 213",
    time: "21:35 - 23 - 40",
    price: "780,000",
  },
  {
    id: 3,
    brand: "VietNam Airline",
    flight: "VN - 213",
    time: "21:35 - 23 - 40",
    price: "780,000",
  },
  {
    id: 4,
    brand: "VietNam Airline",
    flight: "VN - 213",
    time: "21:35 - 23 - 40",
    price: "780,000",
  },
];

const columns = [
  {
    title: "Brand",
    width: 100,
    dataIndex: "brand",
    key: "brand",
    fixed: "left",
  },
  {
    title: "Flight",
    width: 100,
    dataIndex: "flight",
    key: "flight",
    fixed: "left",
  },
  {
    title: "Time",
    dataIndex: "address",
    key: "1",
    width: 150,
  },
  {
    title: "Column 2",
    dataIndex: "address",
    key: "2",
    width: 150,
  },
  {
    title: "Column 3",
    dataIndex: "address",
    key: "3",
    width: 150,
  },
  {
    title: "Column 4",
    dataIndex: "address",
    key: "4",
    width: 150,
  },
  {
    title: "Column 5",
    dataIndex: "address",
    key: "5",
    width: 150,
  },
  {
    title: "Column 6",
    dataIndex: "address",
    key: "6",
    width: 150,
  },
  {
    title: "Column 7",
    dataIndex: "address",
    key: "7",
    width: 150,
  },
  {
    title: "Column 8",
    dataIndex: "address",
    key: "8",
  },
  {
    title: "Action",
    key: "operation",
    fixed: "right",
    width: 100,
    render: () => <a>action</a>,
  },
];
function Flight() {
  return <div className="wrapper"></div>;
}

export default Flight;
